n moglem rywalizowac z absolutna swiatowa czolowka oraz coraz lepiej poznawac akwen olimpijski.  <br />... <br />Bardzo sie ciesze z zajetego miejsca a jeszcze bardziej z ukonczenia wyscigu medalowego na 3 pozycji . Napewno gdyby nie falstart podczas pierwszego dnia w ktorym dojechalem 10 w klasyfikacji koncowej wygladaloby to jeszcze lepiej  <br />Przez pierwsze dwa dni mielismy bardzo fajne slizgowe warunki przy wietrze od brzegu w ktorych super sie odnajdywalem plywajac bardzo rowno i wygrywajac jeden wyscig   <br />... <br />Byl to ostatni miedzynarodowy start w tym roku, glowne starty za nami a plywalo mi sie tu naprawde dobrze  <br />Przed zakonczeniem sezonu startowego jeszcze krajowe Mistrzostwa  ktore odbeda sie pod koniec wrzesnia w NCZ  <br /> <br />Polski Zwiazek Zeglarski <br />Volvo Car Poland <br />Dobrzynski Klub Zeglarski </span> <span class="more_dotes" > ... </span> <a href="" class="ffwd_see_more_description">See more</a>                                                      </p>                                                    											</div>																							<div class="blog_style_image_container_0">													<div class="ffwd_blog_style_object_ver_0" >														<div class="ffwd_blog_style_object_ver_al_0">															<a style="position:relative;" class="ffwd_lightbox_0" href=""  target="_blank" data-id="69" >																<div class="bwg_blog_style_img_cont_0">																	<img id="ffwd_blog_style_img_69_0" class="ffwd_blog_style_img_0" src=""  />																																	</div>															</a>														</div>													</div>												</div>																						<div style="clear:both">											</div>																							<div class="ffwd_title_spun1_0">																											<div class="ffwd_comments_likes_0" style="float:left">																															<div id="ffwd_shares_0_69" class="ffwd_shares_0" style="display : block">																</div>																																<div id="ff